But he did not like such forms and assured them if they did not retire, he would kill some of them; but that he did not wish to do any of them any hurt, and would give them time to withdraw. They thought it most prudent to do this, and the Swimmer remained at [unclear], and rejoined his brother in the woods. Parties were always on the watch; and from time to time the fugitives would be seen for a moment, but never long enough to be caught. 
There was Dance [unclear] winter of 1835, at an Indian's by the name of Woodward, not far from the residence of John Ridge and his father. The Swimmer was seen lurking in the neighborhood. He had been drinking and was decoyed to the dance, where he was found by [unclear]. He was made quite drunk; [unclear] gave him up [unclear] the two hundred dollars; while Swimmer was lodged in jail at [unclear]. 
Hence he seems to have escaped;
